.result th {vertical-align:bottom}

 font-family: "Open Sans",sans-serif; font-size:11px;}
h1  { font-size:25px;  }
th {font-size:14px; }
.list { display:none;
height:auto;
 margin:0;
float: left; }
.show {
display: none; }
.hide:target + .show {
display: inline; }
.hide:target {
display: none; }
.hide:target ~ .list {
display:inline; }
.hide, .show {
width: 16px;
height: 16px;
border-radius: 30px;
font-size: 15px;
color: #000;
text-shadow: 0 1px 0 #666;
text-align: center;
text-decoration: none;
box-shadow: 1px 1px 2px #000;
background: #91DDFE;
opacity: .95;
margin-right: 0;
float: left;
margin-bottom: 25px; }
.hide:hover, .show:hover {
color: #eee;
text-shadow: 0 0 1px #666;
text-decoration: none;
box-shadow: 0 0 4px #222 inset;
opacity: 1;
margin-bottom: 25px; }
.list tr{
height:auto;
margin:0; }
